import React from "react";

class Titles extends React.Component {

  render() {
    return (
      <div>
	<blockquote class="imgur-embed-pub" lang="en" data-id="9ABJnjP"><a href="//imgur.com/9ABJnjP">View post on imgur.com</a></blockquote><script async src="//s.imgur.com/min/embed.js" charset="utf-8"></script>
      </div>
    );
  }
};

export default Titles;
